    // const [Username, setUsername]=useState('')
    const [email, setEmail]=useState('')
    const [password1, setPassword1]=useState('')
    const [password2, setPassword2]=useState('')


   const signupClicked = ({email,password1,password2}) => {

   fetch(`http://127.0.0.1:8000/dj-rest-auth/registration/`,{
                   method:"POST",
                   headers:{
                         'Content-Type':'application/json',
                        },
                   body:JSON.stringify({password2,email,password1,password2})
                }).then(res=>res.json())
                .then(res=>console.log(res))
                .catch(error=>console.log(error))

    // const lfile = new FormData();
    // lfile.append("image",avatar,avatar.name)
  
    // axios.post("api/endpoint/lfile")
   }
    

    return(
        <div>
            <h1>hello this is SignUp page</h1>
           
                {/* <div className="userName">
                    <input type="text" onChange={e=>setUsername(e.target.value)} value={Username} placeholder="inter your userName"/>
                </div> */}
                <div className="email">
                    <input type="email"  onChange={e=>setEmail(e.target.value)} value={email} placeholder="inter your email"/>
                </div>
                <div className="password1">
                    <input type="password"  onChange={e=>setPassword1(e.target.value)} value={password1} placeholder="repeat your password1"/>
                </div>
                <div className="password2">
                    <input type="password"  onChange={e=>setPassword2(e.target.value)} value={password2} placeholder="repeat your password2"/>
                </div>
                
                {/* <div className="avatar">
                    <input type="file" placeholder="avatar" onChange={e=>setAvatar( e.target.files[0]) }/>
                </div> */}
                <div className="submit">
                    <input type="submit" title="Submit"onClick={signupClicked}/>
                </div>

        </div>
    )
}
export default SignUp;
